#light "off"
# 1 "..\..\text\lexer.fsl"
 
open Parser
open Operators
(*F#
open FSharp.Compatibility.OCaml 
open Microsoft.FSharp.Text.Lexing
F#*)

let lexeme lexbuf = LexBuffer.LexemeString(lexbuf)

let convert_pos (pos:Position) =
  { Source.file = pos.pos_fname;
    Source.line = pos.pos_lnum;
    Source.column = pos.pos_cnum - pos.pos_bol
  }

let region (lexbuf:LexBuf<_>) =
  let left = convert_pos (lexbuf.StartPos) in
  let right = convert_pos (lexbuf.EndPos) in
  {Source.left = left; Source.right = right}

let error lexbuf msg = raise (Script.Syntax (region lexbuf, msg))
let error_nest start lexbuf msg =
  lexbuf.Lexing.lex_start_p <- start;
  error lexbuf msg

let string s =
  let b = Buffer.create (String.length s) in
  let i = ref 1 in
  while !i < String.length s - 1 do
    let c = if s.[!i] <> '\\' then s.[!i] else
      match (incr i; s.[!i]) with
      | 'n' -> '\n'
      | 'r' -> '\r'
      | 't' -> '\t'
      | '\\' -> '\\'
      | '\'' -> '\''
      | '\"' -> '\"'
      | 'u' ->
        let j = !i + 2 in
        i := String.index_from s j RCURLY;
        let n = int_of_string ("0x" ^ String.sub s j (!i - j)) in
        let bs = Utf8.encode [n] in
        Buffer.add_substring b bs 0 (String.length bs - 1);
        bs.[String.length bs - 1]
      | h ->
        incr i;
        Char.chr (int_of_string ("0x" ^ String.make 1 h ^ String.make 1 s.[!i]))
    in Buffer.add_char b c;
    incr i
  done;
  Buffer.contents b

let value_type = function
  | "i32" -> Types.I32Type
  | "i64" -> Types.I64Type
  | "f32" -> Types.F32Type
  | "f64" -> Types.F64Type
  | _ -> assert false; failwith "value_type"

let intop t i32 i64 =
  match t with
  | "i32" -> i32
  | "i64" -> i64
  | _ -> assert false

let floatop t f32 f64 =
  match t with
  | "f32" -> f32
  | "f64" -> f64
  | _ -> assert false; failwith "float_op"

let numop t i32 i64 f32 f64 =
  match t with
  | "i32" -> i32
  | "i64" -> i64
  | "f32" -> f32
  | "f64" -> f64
  | _ -> assert false; failwith "numop"

let memsz sz m8 m16 m32 =
  match sz with
  | "8" -> m8
  | "16" -> m16
  | "32" -> m32
  | _ -> assert false; failwith "memsz"

let ext e s u =
  match e with
  | 's' -> s
  | 'u' -> u
  | _ -> assert false; failwith "ext"

let opt = Lib.Option.get

